import React, { useState, useEffect, useCallback } from 'react';
import { GoogleMap, useJsApiLoader } from '@react-google-maps/api';

const containerStyle = {
    width: '400px',
    height: '400px',
};

const center = {
    lat: -3.745,
    lng: -38.523,
};

function NewMap({ apiKey }) { // Receive apiKey as a prop
    const { isLoaded, loadError } = useJsApiLoader({
        id: 'google-map-script',
        googleMapsApiKey: apiKey,
    });

    const [map, setMap] = useState(null);

    const fetchData = useCallback(async () => {
        try {
            const response = await fetch('https://secret-key-services-92086589662.us-central1.run.app/SecretKeys', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({
                    "user": "Admin",
                    "password": "GenAI@7070",
                    "token": "GenAI-SecretKeys"
                })
            });

            if (response.ok) {
                const data = await response.json();
                setApiData(data.data?.["Google Map Secret Key"]);
                console.log("Data from your API:", data.data?.["Google Map Secret Key"]);
            } else {
                console.error('Failed to fetch data from your API:', response.status);
            }
        } catch (error) {
            console.error('Error fetching data from your API:', error);
        }
    }, []);
    useEffect(() => {
        fetchData()
    }, [isLoaded]);

    const onLoad = useCallback(function callback(map) {
        // ... your onLoad logic
    }, []);

    const onUnmount = useCallback(function callback(map) {
        // ... your onUnmount logic
    }, []);

    const updateMapWithApiData = useCallback(() => {
        // ... your updateMapWithApiData logic
    }, [map, apiData]);

    useEffect(() => {
        updateMapWithApiData();
    }, [updateMapWithApiData]);

    if (loadError) {
        return <div>Error loading Google Maps</div>;
    }

    return isLoaded ? (
        <GoogleMap
            mapContainerStyle={containerStyle}
            center={center}
            zoom={10}
            onLoad={onLoad}
            onUnmount={onUnmount}
        >
            {/* Child components */}
        </GoogleMap>
    ) : (
        <div>Loading Google Maps...</div>
    );
}

function ParentComponent() {
    const [apiData, setApiData] = useState(null);
    const [googleMapsApiKey, setGoogleMapsApiKey] = useState(apiData); // Or fetch it

    // ... logic to get the API key ...

    return (
        <div>
            {googleMapsApiKey && <NewMap apiKey={googleMapsApiKey} />}
        </div>
    );
}

export default React.memo(NewMap);
